pragma solidity ^0.8.0;

import "./Compare.sol";

interface ICompare {

    modifier compareStrings ( string memory _a, string memory _b  ) 
    {
        require ( Compare.compareStrings( _a, _b ), "Compare Strings: the two strings are not the same" );
        _;
    }

    modifier compareUint256 ( uint256 _a, uint256 _b  ) 
    {
        require ( Compare.compareUint256( _a, _b ), "Compare Uint256: the two uint256 are not the same" );
        _;
    }

    modifier NGreaterThenZero ( uint256 _a ) 
    {
        require ( Compare.NGreaterThenZero( _a ), "Compare Uint256: the uint256 is not greater then zero" );
        _;
    }
}

