// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;


library Compare {

    function compareStrings ( string memory _a, string memory _b ) internal pure returns ( bool ) 
    {
        return ( keccak256 ( abi.encodePacked( ( _a ) ) ) == keccak256 ( abi.encodePacked ( ( _b ) ) ) );
    }

    function compareUint256 ( uint256 _a, uint256 _b ) internal pure returns ( bool ) 
    {
        return ( keccak256 ( abi.encodePacked( ( _a ) ) ) == keccak256 ( abi.encodePacked( ( _b ) ) ) );
    }

    function NGreaterThenZero ( uint256 _a ) internal pure returns ( bool ) 
    {
        return ( _a > 0 );
    }

}
